import './LoginFrame.css';
import loginLogo from '../../images/логотип NN.svg';
import {Link} from "react-router-dom";


const LoginFrame = (props) => {
    return (
        <div className="login">
            <div className="login__content">
                <img className="login__logo" src={loginLogo} alt="логотип"/>
                <button className="login__button" type="button" onClick={props.onClick}>
                    <Link to="/signin" className="login__link">Войти</Link>
                </button>
            </div>
        </div>
    );
};

export default LoginFrame;
